import React from "react";

const Note = (props) => {
    return (
    <>
        <div className="note">
            <h2>{props.title}</h2>
            <p>{props.content}</p>
            <button className="delete_btn">
                Delete
            </button>
        </div>
    </>
    );
};

export default Note;
